import Button from "react-bootstrap/Button";
import { Container } from "react-bootstrap";
import Card from "react-bootstrap/Card";
import { Row } from "react-bootstrap";
import { Col } from "react-bootstrap";



import "bootstrap/dist/css/bootstrap.min.css";

function VictimReqMain() {
  const styles = {
    cardImg: {
      width: "15vw",
      height: "10",
      padding: "10px",
    },
  };
  return (
    <>
      <div style={{ margin: "auto", width: "50%" }} className="mt-5">
        <Card style={{ width: "30rem" }} classNam="mt-5">
        <Alert variant="success">
      <Alert.Heading>Hey, nice to see you</Alert.Heading>
      <p>
        Aww yeah, you successfully read this important alert message. This
        example text is going to run a bit longer so that you can see how
        spacing within an alert works with this kind of content.
      </p>
      <hr />
      <p className="mb-0">
        Whenever you need to, be sure to use margin utilities to keep things
        nice and tidy.
      </p>
    </Alert>
          <Row>
            <Col sm={6}>
              <Card.Img
                style={styles.cardImg}
                src={require("../../images/rescue.png")}
              />
            </Col>
            <Col sm={6}>
              <div>
                <Button className="mt-5">Rescue Request</Button>
              </div>
            </Col>
          </Row>
          <Row>
            <Col sm={6}>
              <Card.Img
                style={styles.cardImg}
                src={require("../../images/medical.png")}
              />
            </Col>
            <Col sm={6}>
              {" "}
              <Button className="mt-5">Food & Medical Request</Button>
            </Col>
          </Row>
          <Row>
            <Col sm={6}>
              <Card.Img
                style={styles.cardImg}
                src={require("../../images/shelter.png")}
              />
            </Col>
            <Col sm={6}>
              {" "}
              <Button className="mt-5">Shelter Request</Button>
            </Col>
          </Row>
        </Card>
      </div>
    </>
  );
}

export default VictimReqMain;
